import CartItem from "./CartItems";
import Style from "./Cart.module.css"
import Card from "../UI/Card";

export default function Cart(){
    return (
        <div>
            <Card className={Style["cart-items"]}>
                <CartItem />
                <div className={Style.total}>
                    <h2>Total Amount</h2>
                    <div>
                        <p>$</p>
                        <div className={Style.actions}>
                            <button>Close</button>
                            <button>Order</button>
                        </div>
                    </div>
                </div>
            </Card>
        </div>
    );
}
